import './Dashboard.css'
import React, { useEffect, useState } from 'react'
import { useNavigate, Outlet, Link, useLocation, useParams } from 'react-router-dom'
import axios from 'axios'
import { useTheme } from '@mui/material/styles'
import Navbar from './Navbar'
import Note from './Note'
function Dashboard() {
  const theme = useTheme()
  let location = useLocation()
  const navigate = useNavigate()
  const [Notes, setNotes] = useState()

  const { id } = useParams()

  const onClose = (e) => {

    e.stopPropagation()

    navigate(-1)
  }


  const verifyUser = async () => {
    try {
      const response = await axios.get('/api/dashboard/notes', {
        withCredentials: true,
      })
      if (response?.status === 200) {
        setNotes(response?.data?.notes)
        console.log('printing resonse', response?.data?.notes)
      }
    } catch (err) {
      console.log('error from dashboard js file', err)
      navigate('/login')
    }
  }

  useEffect(() => {
    verifyUser()
  }, [])

  return (
    <>
      <Navbar />
      <div className='notes-wrapper' onClick={onClose}>
        {Notes &&
          Notes.map((note) => {
            return (
              <Link
                key={note._id}
                to={`/api/dashboard/notes/${note._id}`}
                state={{ background: location }}
              >
                <main key={note._id}>
                  {/* Title: {note.title}
                  Body: {note.body} */}
                  <Note note={note} />
                </main>
              </Link>
            )
          })}
        <Outlet />
      </div>
    </>
  )
}

export default Dashboard
